import React, { useEffect, useState } from 'react'

const Header = () => {
  const [data, setData] = useState('');

  useEffect(()=>{
    async function Res(){
        const result = await fetch('http://localhost:5555/books')
        const res = await result.json()
        setData(res.count)
    } 

    Res();
  })
  return (
    <div>
      <p>Home</p>
      <p>Add Book</p>
      <p></p>
      <p></p>
    </div>
  )
}

export default Header
